function Contacts(){

    const handleChange = (event) => {
      setInputValue(event.target.value);
    };
  
    return (
      <div>
        <h1>Input en React</h1>
        <input type="text"  onChange={handleChange} />
        <p>El valor del input es: {inputValue}</p>
      </div>
    );
};

export default Contacts;
